import Head from 'next/head';
import Nav from './nav';

export default props => (
    <root>
        <section class="page">
            <Head>
                <link href="https://bootswatch.com/4/cerulean/bootstrap.min.css" rel="stylesheet"></link>
            </Head>
            <Nav />
                {props.children}
        </section>
    </root>
);
